window.bookSummaryJSON = "<p><b><i>New York Times</i></b><b> Best Seller</b></p> <p><b>MacKayla Lane faces the ultimate threat when war breaks out between the kingdoms of shadow and light, as the Fever series races to an explosive revelation.</b></p> <p>From the moment MacKayla Lane arrived in Dublin to hunt her sister’s murderer, she’s had to fight one dangerous battle after the next: to survive, to secure power, to keep her city safe, to protect the people she loves.</p> <p><i>The matter of who’s good and who’s evil can be decided by the answer to a single question: Whose side are you on?</i></p> <p>Now, as High Queen of the Fae, Mac faces her greatest challenge yet: ruling the very race she was born to hunt and kill - a race that wants her dead yesterday, so they can put a pure-blooded Fae queen on the throne.</p> <p>But challenges with her subjects are the least of her concerns when an ancient, deadly foe resurfaces, changing not only the rules of the game but the very game itself, initiating a catastrophic sequence of events that have devastating consequences and leave Mac questioning everything she’s ever learned and everyone she’s ever loved. Now begins an epic battle between Mortal and Fae, Seelie and Unseelie, would-be kings and would-be queens, with possession of the Unseelie King’s virtually unlimited power and the fate of humanity at stake.</p> <p>From the exquisite, deadly gardens of the High Queen’s court, to long-forgotten truths found in the Sacred Grove of Creation, from the erotic bed of her enigmatic, powerful lover to the darkest, seductive reaches of the Unseelie kingdom, Mac’s final journey takes her places no human has been before, and only one human could possibly survive....</p> <p>One who's willing to sacrifice <i>everything</i>.</p>"; 
